import BasicMathsResults from './component/Graphs/BasicMathsGraphs';
import ChemistryResults from './component/Graphs/ChemistryGraphs';
import Homepage from './component/Home/Homepage';
import CarouselPage from './component/Carousel/CarouselPage';
import Home from './component/Home/Homepage';
import Blogs from './component/Navbar/HomeNav';
import Contact from './component/Home/Homepage';
function App() {
  return (
    <>
      <div className="App">

{/* <Signin></Signin> */}
{/* <Student_Signup></Student_Signup> */} 

{/* <Counselor_Signup></Counselor_Signup> */}
      {/* <Routs/> */}



{/* 
<Student_Signup></Student_Signup>
<Student_Next_Signup></Student_Next_Signup> */}
    <Routes>
    <Route path="/" element={<Homepage />}></Route>
    <Route path="/CarouselPage" element={<CarouselPage/>}></Route>
    <Route path="/Login" element={<Signin/>}></Route>
      <Route index element={<Home />} />
      <Route path="blogs" element={<Blogs />} />
      <Route path="contact" element={<Contact />} />
      <Route path="*" element={<NoPage />} />

  </Routes> 

      </div>
    </>

  );
}

export default App;
